    // const image=`https://api.unsplash.com/search/photos?page=1&query=mango`;
    const image=`https://api.unsplash.com/?mango`;
return(
    <>
        <div>
            <img src={image} alt="Random-image" />
        </div>
    </>
);
}
export default Sresult;
